import React from "react";
import './Intro.css'

export const Intro = () =>{
    return(
        <div className="Intro">
            <div className="i-left"></div>
            <div className="i-name">
                <span>Hy! I Am</span>
                <span>Sanket Arote</span>
                <span>FrontEnd Developer with high level of experience in web designing </span>
            </div>
            <button className="button i-button">Hire Me</button>
            <div className="i-right"></div>
        </div>
    )
}

// export default Intro;
